import React from 'react';

function M() {
    return (
        <div className='m'>hello from M</div>
    )
}

function B() {
    return (
        <div className='m'>{2 + 2}</div>
    )
}

function App() {
    return (
        <div>
            <div></div>
            <div className='center'>
                <M />
                <p>html tag</p>
                <B />
            </div>
        </div>
    )
}

export default App;
